import React from "react";
import "./Header.css";

export default function Header() {
  return (
    <header className="header">
      <nav>
        <ul>
          <li>Головна</li>
          <li>Аналіз</li>
          <li>Список витрат</li>
        </ul>
      </nav>
    </header>
  );
}
